#RES Like default printer screen
#Edwin ten Haaf T4Change

#get current default printer
$Default = Get-WmiObject -Query " SELECT * FROM Win32_Printer WHERE Default=$true" | select Name,Location

#get list of printers
$Printers = Get-Printer

#error check in case there are no printers
if (!$Printers) 
{
    [System.Windows.MessageBox]::Show('No Printers found, please install one first!','No Default printer','OK','Error') 
    exit
}

#Build windows
Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

$form = New-Object System.Windows.Forms.Form
$form.Text = 'Printer Selection v0.1'
$form.Size = New-Object System.Drawing.Size(400,310)
$form.StartPosition = 'CenterScreen'                   # CenterScreen, Manual, WindowsDefaultLocation, WindowsDefaultBounds, CenterParent
$Form.Opacity = 1.0                                   # 1.0 is fully opaque; 0.0 is invisible
$Form.BackColor = "white"


$OKButton = New-Object System.Windows.Forms.Button
$OKButton.Location = New-Object System.Drawing.Point(225,240)
$OKButton.Size = New-Object System.Drawing.Size(75,23)
$OKButton.Text = 'OK'
$OKButton.Add_Click({
    SetDefaultPrinter

})

$form.Controls.Add($OKButton)


$CancelButton = New-Object System.Windows.Forms.Button
$CancelButton.Location = New-Object System.Drawing.Point(300,240)
$CancelButton.Size = New-Object System.Drawing.Size(75,23)
$CancelButton.Text = 'Cancel'
$CancelButton.DialogResult = [System.Windows.Forms.DialogResult]::Cancel
$form.CancelButton = $CancelButton
$form.Controls.Add($CancelButton)

$label = New-Object System.Windows.Forms.Label
$label.Location = New-Object System.Drawing.Point(20,60)
$label.Size = New-Object System.Drawing.Size(210,18)
$label.Text = 'Please select a default printer!'
$form.Controls.Add($label)

$listBox = New-Object System.Windows.Forms.ListBox
$listBox.Location = New-Object System.Drawing.Point(20,100)
$listBox.Size = New-Object System.Drawing.Size(350,5)
$listBox.Height = 130

#Fill listbox with current printers
ForEach ($Printer in $Printers)
{
    if($Printer.Name -eq $Default.Name)
    {
        $Printer = $Printer.Name + " (CURRENT DEFAULT)"
        $listBox.Items.Add($Printer) | Out-Null
    }
    else
    {
        $listBox.Items.Add($Printer.Name) | Out-Null
    }
    

}

$form.Controls.Add($listBox)
$form.Topmost = $true


$PrinterB64 = "
"
$PrinterImg = [convert]::FromBase64String($PrinterB64)
$form.Icon = $PrinterImg


$T4LogoB64 = ""
$T4LogoImg = [convert]::FromBase64String($T4LogoB64)
$LogoT4Change = New-Object System.Windows.Forms.PictureBox
$LogoT4Change.Location = New-Object System.Drawing.Size(10,10) 
$LogoT4Change.Width = $ImageT4c.Size.Width
$LogoT4Change.Height = $ImageT4c.Size.Height
$LogoT4Change.AutoSize = $true
$LogoT4Change.Image = $T4LogoImg 
$Form.Controls.add($LogoT4Change)


Function SetDefaultPrinter
{

    $selection = $listBox.SelectedItem
    If($selection)
    {
        #set selection as default printer 
        (Get-WmiObject -ComputerName . -Class Win32_Printer -Filter "Name='$selection'").SetDefaultPrinter() | Out-Null
        
        #check new default
        $NewDefault = Get-WmiObject -Query " SELECT * FROM Win32_Printer WHERE Default=$true" | select Name
        [System.Windows.MessageBox]::Show('default printer set to: '+$selection,'Default printer','OK','Info')
    
    } 
    Else 
    { 
        [System.Windows.MessageBox]::Show('Oeps, er ging iets mis!','Default printer','OK','Error') 
    } 
}


$form.ShowDialog()